<item>
<title>2007-07-12 12:34:49</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerAdd/DealerAddExm/show&amp;time=2007-07-12+12%3A34%3A49</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerAdd/DealerAddExm&amp;amp;v=q6e" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Dealer&amp;nbsp;Section&amp;nbsp;/&amp;nbsp;Dealer&amp;nbsp;Add&amp;nbsp;/&amp;nbsp;Dealer&amp;nbsp;Add&amp;nbsp;Exm&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerAdd/DealerAddExm&amp;amp;time=2007-07-12+12%3A34%3A49">2007-07-12 12:34:49&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerAdd/DealerAddExm&amp;amp;time=2007-07-12+12%3A45%3A26">2007-07-12 12:45:26&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">&lt;ul>&lt;li> открыть форму «Oper rights» в&amp;nbsp;разделе «Administration» и&amp;nbsp;назначить дилеру права на&amp;nbsp;оператора:
&lt;div class="indent"> 1. Следует выбрать из&amp;nbsp;ниспадающего списка в&amp;nbsp;поле «Select user group» название группы «Diller»;&lt;br />
 2. В&amp;nbsp;поле «Select user» выбрать имя&amp;nbsp;дилера, за&amp;nbsp;которым необходимо закрепить оператора; &lt;br />
 3. Выбрать из&amp;nbsp;списка операторов того оператора, которого необходимо закрепить за&amp;nbsp;дилером поставив галочки на&amp;nbsp;оригинацию и&amp;nbsp;терминацию в&amp;nbsp;полях «View origination» и&amp;nbsp;«View termination»; &lt;br />
 4. Нажать кнопку «Change rights» для&amp;nbsp;подтверждения внесенных параметров.&lt;/div>&lt;/li>&lt;/ul>
См.&amp;nbsp;рис.:&lt;/div>&lt;/div>
</description>
</item>
